import{_ as r}from"./questbook5-3c567dfb.js";import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{r as a,o as n,c as o,d as p,e as t,b as l,w as c,f as d}from"./app-6846f88c.js";const s="/WynncraftCNguide/assets/img/lootrun1.jpg",h="/WynncraftCNguide/assets/img/lootrun3.jpg",g="/WynncraftCNguide/assets/img/lootrun2.jpg",u="/WynncraftCNguide/assets/img/lootrun4.jpg",m="/WynncraftCNguide/assets/img/lootrun5.jpg",f="/WynncraftCNguide/assets/img/lootrun6.jpg",y="/WynncraftCNguide/assets/img/lootrun7.jpg",b="/WynncraftCNguide/assets/img/lootrun8.jpg",x="/WynncraftCNguide/assets/img/lootrun9.jpg",_="/WynncraftCNguide/assets/img/lootrun12.jpg",C="/WynncraftCNguide/assets/img/lootrun10.jpg",v="/WynncraftCNguide/assets/img/lootrun11.jpg",L="/WynncraftCNguide/assets/img/lootrun13.jpg",S={},I=d('<p>首先先解释一下，何谓lootrun?</p><p>lootrun即跑箱，在一定的区域内寻找散落在各处的宝箱并开启，以此来获取装备，一般简称lr</p><p>通常情况下，lr的终极目标即获取稀有度最高的Mythic品质装备</p><p>大部分Mythic装备都拥有高于其他品质的属性以及价值</p><blockquote><p>小部分呢？我不好说。</p></blockquote><p><strong>无论何时，lr均是获取装备的重要来源</strong></p><p>本篇将会介绍新旧两种lr方式</p><h2 id="传统lootrun" tabindex="-1"><a class="header-anchor" href="#传统lootrun" aria-hidden="true">#</a> 传统Lootrun</h2><p>从刚进入游戏开始，你就可以为了获取装备去进行传统lr了</p><p>先介绍一下，箱子一共有四个等级，以下简称T1-T4</p><p><strong>对于每一个箱子来说，刷新时间越久，箱子质量越高</strong></p><div class="hint-container tip"><p class="hint-container-title">提示</p><p>刚刷新出来的箱子质量非常低</p><p>刷新时间是分个人而非共享</p></div><p>T1-T2箱子分布在野外，箱子数量多，但是箱子质量不是很高，追求一个走量</p><figure><img src="'+s+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>',14),k=d('<p>需要注意的是，现在每一个T3/T4箱子都有开启条件，一般来说都是在附近击杀怪物解锁。</p><figure><img src="'+h+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>你可以靠近箱子来查看条件，注意只有箱子一定范围内的怪物才算作击杀数。</p><p>每一个洞穴门口都会显示当前洞穴的状态</p><figure><img src="'+g+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>其中，<code>Loot Quality</code>表示洞穴内箱子的质量(刷新时间)</p><p>而<code>Progress</code>表示当前洞穴的探索情况，若不是Completed(100%)，则代表洞穴内尚有未开启过的T3/T4箱子</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p>这里的Loot Quality注意要和下文中提到的物品词条区分开来</p><p>一般来说，玩家群体间用的Loot Quality(简称lq)常指物品词条</p></div><p>现在来说，效率比较高的lr方式就是一直跑洞穴，同时路上顺手开启一些T1-T2箱子</p><p>同时，Mythic品质仅存在于66-104级，如果开箱的区域等级不在这些等级里面，你是跑不到Mythic装备的</p><h3 id="提高效率的方法" tabindex="-1"><a class="header-anchor" href="#提高效率的方法" aria-hidden="true">#</a> 提高效率的方法</h3><p>有两个非常影响效率的词条，<code>Loot Bonus</code>以及<code>Loot Quality</code></p><p>你可以在大部分装备上发现<code>Loot Bonus</code>词条</p><p><code>Loot Bonus</code>能提高箱子的物品数量，也就是说你能开到更多的物品</p><figure><img src="'+u+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>而<code>Loot Quality</code>仅存在于素材当中，你只能通过自制装备来获取<code>Loot Quality</code></p><figure><img src="'+m+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p><code>Loot Quality</code>能提高箱子的物品质量，可以理解为提高神话的出率，同时还能开到更多传奇物品。</p><p>就现有的材料来说，你无法在100级前正常获得<code>Loot Quality</code>属性</p><h3 id="如何出发" tabindex="-1"><a class="header-anchor" href="#如何出发" aria-hidden="true">#</a> 如何出发？</h3><p>无论你多少级，你都可以开始lr</p><p>首先，最好有一个比较可观的<code>Loot Bouns</code>加成</p><p>你可以通过在市场上进行条件筛选来购买到合适的LB装备</p><figure><img src="'+f+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><div class="hint-container warning"><p class="hint-container-title">注意</p><p>部分lb装备可能会比较贵！</p></div><p>接着在你想进行lr的区域附近找一个城镇做好补给，比如购买充足的消耗品</p><p>然后就可以出发寻找箱子了！</p><p>记住你获得的装备要到鉴定师鉴定后才可以使用</p><h2 id="新lootrun" tabindex="-1"><a class="header-anchor" href="#新lootrun" aria-hidden="true">#</a> 新Lootrun</h2><p>在2.0.3更新后，增加了一种全新的Lootrun方式</p><h3 id="开始lootrun前" tabindex="-1"><a class="header-anchor" href="#开始lootrun前" aria-hidden="true">#</a> 开始lootrun前</h3><p>在开始之前，你首先需要来到<strong>Cinfras</strong>附近的<strong>Silverbull Trading Company</strong>，和<em>Lootrun Chief</em><code>[-102 36 -4814]</code>对话来解锁lootrun以及<code>Silverbull Syndicate</code>副职</p><p>然后你就能通过任务书来找到<strong>Lootrun Camp</strong>了</p><figure><img src="'+r+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>截止至2.0.4版本，一共有4处<strong>Lootrun Camp</strong></p><p>它们分别位于<strong>Molten Heights</strong>(火山)、<strong>Sky Islands</strong>(Sky)、<strong>Corkus</strong>、<strong>Silent Expanse</strong>(se)</p><p>你可以找到<strong>Lootrun Camp</strong>中的<em>Lootrun Master</em>来开始新lr</p><figure><img src="'+y+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>每一局lr的成功结算都可以增加<code>Silverbull Syndicate</code>的等级，经验上限为500(每日奖励的100经验不包含在上限内)</p><p>同时随着<code>Silverbull Syndicate</code>等级的提升，你都可以在lr中体验到新的内容</p><details class="hint-container details"><summary>升级追加内容一览</summary><table><thead><tr><th>等级</th><th>名称</th><th>所需经验</th><th>总计经验</th><th>效果</th></tr></thead><tbody><tr><td>1</td><td>Rookie I</td><td>0</td><td>0</td><td>无</td></tr><tr><td>2</td><td>Rookie II</td><td>100</td><td>100</td><td>解锁青色信标</td></tr><tr><td>3</td><td>Rookie III</td><td>100</td><td>200</td><td>解锁橙色信标</td></tr><tr><td>4</td><td>Assistant I</td><td>100</td><td>300</td><td>增加1次信标重抽机会</td></tr><tr><td>5</td><td>Assistant II</td><td>100</td><td>400</td><td>解锁绿色信标</td></tr><tr><td>6</td><td>Assistant III</td><td>120</td><td>520</td><td>+50%挑战外移动速度；+5%vib信标转换概率</td></tr><tr><td>7</td><td>Sentinel I</td><td>150</td><td>670</td><td>解锁暗灰信标</td></tr><tr><td>8</td><td>Sentinel II</td><td>190</td><td>860</td><td>+1基础信标选数</td></tr><tr><td>9</td><td>Sentinel III</td><td>240</td><td>1100</td><td>解锁白色信标</td></tr><tr><td>10</td><td>Elite I</td><td>300</td><td>1400</td><td>解锁灰色信标</td></tr><tr><td>11</td><td>Elite II</td><td>380</td><td>1780</td><td>+1最终奖励重抽机会(每日奖励)</td></tr><tr><td>12</td><td>Elite III</td><td>480</td><td>2260</td><td>解锁红色信标</td></tr><tr><td>13</td><td>Admiral</td><td>600</td><td>2860</td><td>+5%vib信标转换概率(共10%)</td></tr><tr><td>14</td><td>Commander</td><td>750</td><td>3610</td><td>增加1次信标重抽机会(共2次)</td></tr><tr><td>15</td><td>Master</td><td>1000</td><td>4610</td><td>解锁彩虹色新标</td></tr><tr><td>16</td><td>Grandmaster</td><td>4000</td><td>8610</td><td>无</td></tr></tbody></table></details><h3 id="开始lootrun" tabindex="-1"><a class="header-anchor" href="#开始lootrun" aria-hidden="true">#</a> 开始lootrun</h3><p>与Lootrun Master对话后，你就可以开始新lootrun了</p><p>你可以在此看到最小挑战轮数以及最大挑战轮数还有基础挑战轮数。</p><figure><img src="'+b+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>每个账号在每天第一次lootrun完成时，都能获得每日奖励</p><p>在开始游戏后，你可以看到计分板出现计时器以及轮次数</p><figure><img src="'+x+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>同时，你可以在任何时候找NPC结算(或者投降。)</p><figure><img src="'+_+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>结算效果等于直接放弃接下来所有挑战数</p><div class="hint-container warning"><p class="hint-container-title">注意</p><p>只有在成功完成4轮挑战后，整局lootrun才算成功</p><p>在此之前若你失败过多次或找NPC直接结算，都会直接判Lootrun Failed且不会有任何奖励</p></div><h3 id="计时器" tabindex="-1"><a class="header-anchor" href="#计时器" aria-hidden="true">#</a> 计时器</h3><p>一旦计时器耗尽或者轮次数耗尽，你都会被立刻结算并且传送回Lootrun Camp</p><p>当每轮开始时，都会获得1min或2min的时间</p><p>当挑战成功后，获得2min的时间</p><p>若任何时候死亡或挑战失败，均会扣除1min的时间</p><p>总时间上限为15分钟，除了绿信标以外，其他任何正常方式均无法使计时器超过15分钟</p><p>在超过15分钟时，进出挑战仅会获得1s的时间加成</p><div class="hint-container warning"><p class="hint-container-title">注意</p><p>若持有红信标给的轮次，此时仅可通过绿信标来获取时间，无法从其他任何途径来额外增加时间</p></div><h3 id="信标" tabindex="-1"><a class="header-anchor" href="#信标" aria-hidden="true">#</a> 信标</h3><figure><img src="'+C+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>在开始挑战后，你会被随机分配2个(升级后为3个)信标，通过走到信标处开启挑战并完成，你就可以得到信标的效果</p><p>每轮挑战都会给你随机分配当前信标选数的信标，并且信标不会重复</p><p>对于每个信标，在没有彩虹信标且满级的情况下，有10%的概率升级为Vibrant信标</p><p>Vibrant信标拥有原信标的双倍效果</p><p>基础信标效果如下表所示</p><table><thead><tr><th>信标名称</th><th>效果</th><th style="text-align:center;">最大获取上限</th></tr></thead><tbody><tr><td>蓝色信标</td><td>从3个增益效果中选择1个</td><td style="text-align:center;">无上限</td></tr><tr><td>紫色信标</td><td>获得1个随机诅咒，同时最终奖励抽取物品数+1</td><td style="text-align:center;">无上限</td></tr><tr><td>黄色信标</td><td>生成一个Flying Chest</td><td style="text-align:center;">无上限</td></tr><tr><td>青色信标</td><td>下一个信标的效果+100%</td><td style="text-align:center;">无上限</td></tr><tr><td>橙色信标</td><td>在接下来的5轮挑战中，信标选数+1</td><td style="text-align:center;">无上限</td></tr><tr><td>绿色信标</td><td>获得120s的时间，且本轮怪物不会增加属性</td><td style="text-align:center;">无上限</td></tr><tr><td>暗灰色信标</td><td>获得3个随机诅咒，同时最终奖励抽取物品数+3</td><td style="text-align:center;">1</td></tr><tr><td>白色信标</td><td>挑战轮数+5</td><td style="text-align:center;">1</td></tr><tr><td>灰色信标</td><td>从3个任务中选择1个接取</td><td style="text-align:center;">3</td></tr><tr><td>红色信标</td><td>挑战轮数+2，且2轮内不会有时间奖励</td><td style="text-align:center;">无上限</td></tr><tr><td>彩虹信标</td><td>本次lootrun中出现的信标均升级为Vibrant</td><td style="text-align:center;">1</td></tr></tbody></table><p>部分信标有一点需要注意的特性</p><table><thead><tr><th>信标名称</th><th>特性</th></tr></thead><tbody><tr><td>蓝色信标</td><td>青色信标和Vibrant增益的是选数且每+100%为+1选数；选数上限为5</td></tr><tr><td>青色信标</td><td>只会连续出现1次；死亡会导致已持有的青色信标状态清空</td></tr><tr><td>橙色信标</td><td>青色信标和Vibrant增益的是挑战轮数</td></tr><tr><td>绿色信标</td><td>只会连续出现1次；青信标会增益<code>怪物不加属性</code>的轮次数而Vibrant不会</td></tr><tr><td>灰色信标</td><td>和蓝色信标相同；第5轮开始才会出现；第20轮后消失</td></tr><tr><td>红色信标</td><td>只会连续出现1次；给予的不加时间的轮次从下一轮开始算起</td></tr></tbody></table><div class="hint-container warning"><p class="hint-container-title">注意</p><p>对于有上限的信标，当你走进挑战时，就已经计入总数了</p><p>若你挑战失败，你不会得到该信标的效果</p><p>同时意味着你会少吃一个该信标</p></div><h3 id="挑战" tabindex="-1"><a class="header-anchor" href="#挑战" aria-hidden="true">#</a> 挑战</h3><p>挑战一共分为5大类</p><table><thead><tr><th>名称</th><th>目标</th><th>备注</th></tr></thead><tbody><tr><td>Spelunk</td><td>开启洞穴内所有的T3-T4箱子</td><td>每次进入挑战才会刷新箱子</td></tr><tr><td>Slay Mobs</td><td>消灭所有怪物</td><td>-</td></tr><tr><td>Slay Target</td><td>消灭指定发光怪物</td><td>指定目标不一定第一轮就刷新</td></tr><tr><td>Destroy</td><td>消灭指定目标</td><td>类似于拆塔，目标不会攻击没有AI且血量极高</td></tr><tr><td>Defend</td><td>保护指定目标</td><td>只有一些怪物才会攻击目标；每10秒刷新怪物</td></tr></tbody></table><p>在每次挑战完成或者失败后，怪物都会受到轮次增益(获得绿信标效果时除外)</p><figure><img src="'+v+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>这个数值在不同的地区而不同，低等级的地区会有更高的轮次增益来补偿难度</p><h3 id="诅咒" tabindex="-1"><a class="header-anchor" href="#诅咒" aria-hidden="true">#</a> 诅咒</h3><p>在吃到紫信标或暗灰信标后，你会受到随机诅咒(Curses)</p><p>诅咒会给怪物带来加成以提高挑战难度</p><p>诅咒一共会给怪物带来如下增益：</p><ul><li>生命(每次+40%)</li><li>伤害(每次+30%)</li><li>攻击速度(每次+25%)</li><li>移动速度(每次+35%)</li><li>抗性(每次+12%，上限84%)</li></ul><div class="hint-container warning"><p class="hint-container-title">注意</p><p>怪物抗性是非常恐怖的词条</p><p>会直接降低你造成的伤害(加算)</p><p>举个例子，当怪物抗性为84%时，你只能对他造成16%的伤害</p></div><h3 id="增益" tabindex="-1"><a class="header-anchor" href="#增益" aria-hidden="true">#</a> 增益</h3><p>在吃到蓝信标或者有任务加成的紫信标、暗灰信标后，你会受到增益(boon)</p><p>增益会给你带来不同属性的提升以帮助你更好完成接下来的挑战</p><div class="hint-container warning"><p class="hint-container-title">注意</p><p>如果你打算进行较多挑战轮数，一定要持有足够多的增益效果！</p><p>否则你将被滚雪球，存在反复挑战失败的风险</p></div><p>在吃到蓝信标时，你可以从一定选数内选择你想要的增益</p><p>每个增益由触发条件、触发效果以及增益种类三部分组成</p><p>其中，Dynamic为成长型增益，你有机会提高该增益的数值</p><p>Static为固定增益，该增益的数值在拿到瞬间就固定了</p><table><thead><tr><th>名称</th><th>种类</th><th>描述</th><th>最大层数</th></tr></thead><tbody><tr><td>Persnickety</td><td>Dynamic</td><td>当你在这次挑战中见到6个蓝色信标或紫色信标时，获得 <code>增益效果</code></td><td>-</td></tr><tr><td>Picky Looter</td><td>Dynamic</td><td>在这次挑战后，每当你见到一个黄色信标，获得一层 <code>增益效果</code></td><td>x15</td></tr><tr><td>Heavensent</td><td>Dynamic</td><td>在这次挑战后, 每当你见到一个信标，获得一层 <code>增益效果</code></td><td>x15</td></tr><tr><td>Slowrunner</td><td>Dynamic</td><td>在这次挑战后, 当计时器少于6min时，获得 <code>增益效果</code></td><td>-</td></tr><tr><td>Clockworker</td><td>Dynamic</td><td>在这次挑战后, 计时器剩余的每一分钟都会获得一层 <code>增益效果</code></td><td>-</td></tr><tr><td>Looter</td><td>Dynamic</td><td>在这次挑战后, 每从箱子里见到4个物品都会获得一层 <code>增益效果</code></td><td>x15</td></tr><tr><td>Serendipity</td><td>Dynamic</td><td>在这次挑战后, 每次开启箱子都会获得一层 <code>增益效果</code></td><td>x15</td></tr><tr><td>Bad Omen</td><td>Dynamic</td><td>在这次挑战后, 每次获得诅咒都会获得一层 <code>增益效果</code></td><td>x10</td></tr><tr><td>Midas Touch</td><td>Dynamic</td><td>在这次挑战后, 每次获得增益都会获得一层 <code>增益效果</code></td><td>x8</td></tr><tr><td>Killstreak</td><td>Dynamic</td><td>在这次挑战后, 在60s内每当你杀了3只怪物，获得一层 <code>增益效果</code>，持续时间在每次完成条件后都会重置至60s</td><td>-</td></tr><tr><td>Persistent Champion</td><td>Dynamic</td><td>在这次挑战后, 每次完成挑战都会 <code>增益效果</code></td><td>-</td></tr><tr><td>Patient Champion</td><td>Dynamic</td><td>当你总共完成了5个挑战后，获得 <code>增益效果</code></td><td>-</td></tr><tr><td>Parsimonious</td><td>Static</td><td>截止这次挑战前，每共计见到4个物品都会获得一层 <code>增益效果</code></td><td>x12</td></tr><tr><td>Madman</td><td>Static</td><td>截止这次挑战前，你拥有的每一个诅咒都会获得一层 <code>增益效果</code></td><td>x8</td></tr><tr><td>Lightbringer</td><td>Static</td><td>截止这次挑战前，你拥有的每一个增益都会获得一层 <code>增益效果</code></td><td>x6</td></tr><tr><td>Mob Slaughter</td><td>Static</td><td>截止这次挑战前，每共计击杀10只怪物都会获得一层 <code>增益效果</code></td><td>x15</td></tr><tr><td>Retrograde Champion</td><td>Static</td><td>截止这次挑战前，每完成一次挑战都会获得一层 <code>增益效果</code></td><td>x15</td></tr></tbody></table><p>增益效果如下列所示</p><ul><li>生命上限</li><li>生命恢复</li><li>生命恢复%</li><li>移动速度</li><li>伤害</li><li>元素伤害</li><li>暴击伤害</li><li>法术伤害</li><li>属性点</li><li>mana恢复</li><li>战利品加成</li><li>战利品质量</li><li>生命窃取</li></ul><h3 id="任务" tabindex="-1"><a class="header-anchor" href="#任务" aria-hidden="true">#</a> 任务</h3><p>在2.0.4版本中，新增加了任务系统</p><p>在完成4轮挑战后，你可以从3个任务中选择一个进行接取</p><p>任务同样也能通过灰信标接取，总任务上限是4个</p><p>在当前接取任务未完成之前，你无法再看到灰信标</p><p>任务目标是随机的，包括获得时间、获得Pulls、打开箱子、获得增益、获得诅咒以及见到信标</p><p>任务在完成对应目标后会提供非常强力的效果</p><table><thead><tr><th>名称</th><th>效果</th></tr></thead><tbody><tr><td>Cleansing Greed</td><td>每次开启Flying Chest后，随机清除一个已有的诅咒</td></tr><tr><td>High Roller</td><td>获得2次最终奖励刷新机会</td></tr><tr><td>Materialism</td><td>所有挑战额外附加黄色信标的效果，同时黄色信标不再单独出现</td></tr><tr><td>Orphion&#39;s Grace</td><td>增益拥有50%额外效果</td></tr><tr><td>Cleansing Ritual</td><td>每次完成挑战后，可以消费1个诅咒换取1个额外挑战轮数</td></tr><tr><td>Equilibrium</td><td>每次得到1个诅咒后，获得1个随机增益</td></tr><tr><td>Inner Peace</td><td>诅咒效果折半</td></tr><tr><td>Backup Beat</td><td>每次获得360s的时间后，增加一次信标刷新机会</td></tr><tr><td>Stasis</td><td>在信标选择阶段，计时器不会减少时间(持续上限5min)</td></tr><tr><td>Gambling Beast</td><td>每次挑战结束后，可以消费300s换取1次最终奖励刷新机会。时间花费每轮增加60s</td></tr><tr><td>Redemption</td><td>获得1次最终奖励牺牲机会</td></tr><tr><td>Ultimate Sacrifice</td><td>获得1次最终奖励牺牲机会以及2次最终奖励刷新机会；每当计时器减少2min时，随机清除一个已有增益，从任意途径获得时间重置该倒计时</td></tr></tbody></table><div class="hint-container tip"><p class="hint-container-title">提示</p><p>在完成<code>获得时间</code>的条件时</p><p>使用<code>/kill</code>快速减少时间是非常不错的选择</p></div><h3 id="最终奖励" tabindex="-1"><a class="header-anchor" href="#最终奖励" aria-hidden="true">#</a> 最终奖励</h3><p>在完成lootrun后，你可以开启最终奖励宝箱</p><p>最终奖励宝箱会根据你的最终奖励抽取物品数(以下简称pulls)来抽取物品</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p>总物品数上限为36</p><p>如果你的pulls超过了36，则会根据优先级截断优先级较低的物品，保留优先级较高的物品</p></div><p>你可以花费最终奖励刷新机会(以下简称rr)来刷新物品</p><p>rr相当于重抽一次，并不会保留你当前的任何物品</p><p>在确认开启前，你可以随时选择牺牲奖励(以下简称sac)</p><p>sac会放弃当前所有奖励，根据你的sac数来保留当前的一部分pulls至下一局</p><figure><img src="'+L+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><div class="hint-container warning"><p class="hint-container-title">注意</p><p>若你下一局失败了，则sac保留的pulls数会直接作废！</p></div><p>在确认开启后，你就不能进行任何操作了，包括rr和sac</p><h3 id="跑法策略" tabindex="-1"><a class="header-anchor" href="#跑法策略" aria-hidden="true">#</a> 跑法策略</h3><div class="hint-container tip"><p class="hint-container-title">提示</p><p>以下策略在2.0.4版本中编写，存在过时风险！</p></div><p>待更新！！！</p>',117);function N(T,D){const i=a("RouterLink");return n(),o("div",null,[I,p("p",null,[t("T3-T4箱子均在洞穴内，你可以在任务书上轻松找到洞穴的位置，不妨看看"),l(i,{to:"/guide/basesystem/questbook.html#cave"},{default:c(()=>[t("这里")]),_:1})]),k])}const W=e(S,[["render",N],["__file","lootrun.html.vue"]]);export{W as default};
